import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { PlusCircle, X } from 'lucide-react';
import { Button } from '@/components/ui/button';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { Input } from '@/components/ui/input';
import { Table, TableBody, TableCell, TableHead, TableHeader, TableRow } from '@/components/ui/table';

const EmployeeList = ({ employees, contractId, onEdit, onDelete }) => {
  const [editingEmployee, setEditingEmployee] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [editForm, setEditForm] = useState({
    name: '',
    epf: '',
    esic: '',
    bankAccount: '',
    aadhar: '',
    mobile: '',
    dailyWage: '',
    jobRole: '',
  });

  const [newEmployee, setNewEmployee] = useState({
    name: '',
    epf: '',
    esic: '',
    bankAccount: '',
    aadhar: '',
    mobile: '',
    dailyWage: '',
    jobRole: ''
  });

  useEffect(() => {
    console.log('Employees prop:', employees);
  }, [employees]);

  const handleEditClick = (employee) => {
    setEditingEmployee(employee._id);
    setEditForm(employee);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setEditForm({ ...editForm, [name]: value });
  };

  const handleNewInputChange = (e) => {
    const { name, value } = e.target;
    setNewEmployee({ ...newEmployee, [name]: value });
  };

  const handleEditSubmit = async (e) => {
    e.preventDefault();
    try {
      console.log('Updating employee with data:', editForm);
      const response = await axios.put(`http://localhost:5000/api/contracts/${contractId}/employees/${editingEmployee}`, editForm);
      console.log('Employee updated successfully:', response.data);
      onEdit(response.data);
      setEditingEmployee(null);
    } catch (error) {
      console.error('Error updating employee:', error);
    }
  };

  const handleDeleteClick = async (employeeId) => {
    if (window.confirm('Are you sure you want to delete this employee?')) {
      try {
        console.log('Deleting employee with ID:', employeeId);
        await axios.delete(`http://localhost:5000/api/contracts/${contractId}/employees/${employeeId}`);
        onDelete(employeeId);
        console.log('Employee deleted successfully');
      } catch (error) {
        console.error('Error deleting employee:', error);
      }
    }
  };

  const handleAddEmployee = async (e) => {
    e.preventDefault();
    try {
      console.log('Adding employee with data:', newEmployee);
      const response = await axios.post(`http://localhost:5000/api/contracts/${contractId}/employees`, newEmployee);
      console.log('Employee added successfully:', response.data);
      setNewEmployee({
        name: '',
        epf: '',
        esic: '',
        bankAccount: '',
        aadhar: '',
        mobile: '',
        dailyWage: '',
        jobRole: ''
      });
      onEdit(response.data);
      setShowForm(false);
    } catch (error) {
      console.error('Error adding employee:', error);
    }
  };

  return (
    <div className="space-y-4">
      <div className="flex justify-between items-center">
        <h2 className="text-2xl font-bold">Employee List</h2>
        <Button onClick={() => setShowForm(!showForm)}>
          {showForm ? <X className="mr-2" /> : <PlusCircle className="mr-2" />}
          {showForm ? 'Close Form' : 'Add Employee'}
        </Button>
      </div>

      {showForm && (
        <Card>
          <CardHeader>
            <CardTitle>Add New Employee</CardTitle>
          </CardHeader>
          <CardContent>
            <form onSubmit={handleAddEmployee} className="space-y-4">
              <Input type="text" name="name" placeholder="Name" value={newEmployee.name} onChange={handleNewInputChange} required />
              <Input type="text" name="epf" placeholder="EPF" value={newEmployee.epf} onChange={handleNewInputChange} required />
              <Input type="text" name="esic" placeholder="ESIC" value={newEmployee.esic} onChange={handleNewInputChange} required />
              <Input type="text" name="bankAccount" placeholder="Bank Account" value={newEmployee.bankAccount} onChange={handleNewInputChange} required />
              <Input type="text" name="aadhar" placeholder="Aadhar" value={newEmployee.aadhar} onChange={handleNewInputChange} required />
              <Input type="text" name="mobile" placeholder="Mobile" value={newEmployee.mobile} onChange={handleNewInputChange} required />
              <Input type="number" name="dailyWage" placeholder="Daily Wage" value={newEmployee.dailyWage} onChange={handleNewInputChange} required />
              <Input type="text" name="jobRole" placeholder="Job Role" value={newEmployee.jobRole} onChange={handleNewInputChange} required />
              <Button type="submit">Add Employee</Button>
            </form>
          </CardContent>
        </Card>
      )}

      {employees.length === 0 ? (
        <p>No employees found.</p>
      ) : (
        <Table>
          <TableHeader>
            <TableRow>
              <TableHead>Name</TableHead>
              <TableHead>EPF</TableHead>
              <TableHead>ESIC</TableHead>
              <TableHead>Bank Account</TableHead>
              <TableHead>Aadhar</TableHead>
              <TableHead>Mobile</TableHead>
              <TableHead>Daily Wage</TableHead>
              <TableHead>Job Role</TableHead>
              <TableHead>Actions</TableHead>
            </TableRow>
          </TableHeader>
          <TableBody>
            {employees.map((employee) => (
              <TableRow key={employee._id}>
                {editingEmployee === employee._id ? (
                  <>
                    <TableCell><Input type="text" name="name" value={editForm.name} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="text" name="epf" value={editForm.epf} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="text" name="esic" value={editForm.esic} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="text" name="bankAccount" value={editForm.bankAccount} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="text" name="aadhar" value={editForm.aadhar} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="text" name="mobile" value={editForm.mobile} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="number" name="dailyWage" value={editForm.dailyWage} onChange={handleInputChange} required /></TableCell>
                    <TableCell><Input type="text" name="jobRole" value={editForm.jobRole} onChange={handleInputChange} required /></TableCell>
                    <TableCell>
                      <Button onClick={handleEditSubmit}>Save</Button>
                      <Button onClick={() => setEditingEmployee(null)}>Cancel</Button>
                    </TableCell>
                  </>
                ) : (
                  <>
                    <TableCell>{employee.name}</TableCell>
                    <TableCell>{employee.epf}</TableCell>
                    <TableCell>{employee.esic}</TableCell>
                    <TableCell>{employee.bankAccount}</TableCell>
                    <TableCell>{employee.aadhar}</TableCell>
                    <TableCell>{employee.mobile}</TableCell>
                    <TableCell>{employee.dailyWage}</TableCell>
                    <TableCell>{employee.jobRole}</TableCell>
                    <TableCell>
                      <Button onClick={() => handleEditClick(employee)}>Edit</Button>
                      <Button onClick={() => handleDeleteClick(employee._id)}>Delete</Button>
                    </TableCell>
                  </>
                )}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      )}
    </div>
  );
};

export default EmployeeList;
